        this.popupopen = false;
        this.profilename = "Genny";
        this.branch = "Computer Science";
        this.slideNo = 0;
        this.aboutprofile = "Genny’s career has been driven by equal parts passion and tenacity, traits that have driven her success since working in Deloitte’s Consulting practice. She is now the Head of Listings at Aequitas NEO Exchange,";
        this.profiles = [];
        this.loading = true;
        this.siteUrls = [];
        this.selectedTab = {
            'testimonial': false,
            'gtv': false,
            'contacts': false,
            'galary': false,
        };
